// Navbar.js

import React from 'react';
import { NavbarContainer, Logo, Menu, MenuItem } from './Navbar.styles.js';

const Navbar = () => {
  return (
    <NavbarContainer>
      <Logo>MyApp</Logo>
      <Menu>
        <MenuItem>Home</MenuItem>
        <MenuItem>About</MenuItem>
        <MenuItem>Contact</MenuItem>
      </Menu>
    </NavbarContainer>
  );
};

export default Navbar;
